import "./checkoutTotal.styles.css";

const CheckoutTotal = ({ total }) => {
  console.log(total);
  return (
    <div className="checkout-total">
      <span>Total</span>
      <span>${total}</span>
    </div>
  );
};

export default CheckoutTotal;
